window.bookSummaryJSON = "<p>Jupter Tech's headquarters, Olympus, has been attacked. Lives have been lost in the real world. Alexander and friends must now thwart the servants of the Dark One both in and out of the game. With a few new allies, the Greystone Guild moves out of the noob zones to take on the challenges presented by the ruins of Dire Keep and its inhabitants. They must conquer, rebuild, and defend the Dire Lands against attacking forces. </p> <p>The players (and Fibble) must now overcome tougher dungeons, and more dangerous foes. Even betrayal by one of their own! Soundbooth Theater presents the long anticipated sequel to one of the most beloved LitRPG titles of the year! Jeff Hays has stepped up to take on the narration, and although Laurie Catherine Winkel has taken a back seat for this installment, she still reprises her roles of all the ladies of the Greystone Guild, and of course, Fibble! </p> <p>The Soundbooth Theater team for this production: </p> <ul> <li>Jeff Hays - Narration, sound design </li> <li>Laurie Catherine Winkel - Sasha, Fibble, and the rest of the female cast </li> <li>Dalton Lynne - Proofing and editing </li> <li>Griffin Malnar - Editing and mastering</li> </ul>"; 
